,"faviconImageUrl":"\/resources\/assets\/wbma\/images\/logos\/favicon.ico","weatherImageOneUrl":"http:\/\/sinclairresources.s3.amazonaws.com\/assets\/common\/kutv-weather-hero-day.jpg","weatherImageTwoUrl":"http:\/\/sinclairresources.s3.amazonaws.com\/assets\/common\/kutv-weather-hero-day.jpg","fontUrl":null,"designatedMarketArea":"Birmingham (Ann and Tusc)","dfpNetworkId":"4756","dfpAdUnitId":"WBMA","googleAnalyticsId":"UA-45818038-8","general":{"footerText":"ABC 33\/40 in Birmingham, Alabama offers news, sports, and weather reporting for the surrounding communities including Tuscaloosa, Anniston, Cullman, Gadsden, Talladega, Sylacauga, Carbon Hill, Jasper, Hoover, Bessemer, Vestavia Hills, Alabaster, Trussville and Homewood."},"theme":null,"integration":{"googleTagManagerId":"GTM-P5MSC7H","androidWeatherApp":"","iOSWeatherApp":"","iOSStationApp":"","epgId":"cff6d45f-45d4-4661-a28e-cc1882e37c0b","androidStationApp":"","epgProviders":"[{\"providerName\":\"gracenote\",\"providerConfig\":{\"stationId\":\"72135\"}},{\"providerName\":\"TitanTV\",\"providerConfig\":{\"registrationKey\":\"ACzh98S%2bOE%2bkhMz07a6tyQ%3d%3d\"}}]","customIntegrationPairs":"{}","androidMorningApp":"","iOSMorningApp":"","iOSWatchLiveApp":"","androidWatchLiveApp":""},"sources":null,"social":{"facebookAppId":"899575676795654","pinterestUrl":"","instagramFeedUrl":"https:\/\/instagram.com\/abc3340","googlePlusUrl":"","facebookUrl":"https:\/\/www.facebook.com\/abc3340","fbPages":"75155261177","livestreamFacebookAppId":"156854331444788","youtubeChannelUrl":"","fbRecirculationId":"1804690006431553_1985314585035760","twitterUrl":"https:\/\/twitter.com\/abc3340","twitterAppId":"","googlePlusAppId":""},"packageTypes":null,"affiliate":null},"sections":null},"publishedDateTime":1556794529000,"scheduledDateTime":null,"expiresDateTime":null,"terminatedDateTime":null,"savedDateTime":1556794529000,"publishAuthorizationDateTime":null,"unpublishAuthorizationDateTime":null,"publishedDateISO8601":"2015-07-27T17:14:15.000-04:00","scheduledDateISO8601":"2019-05-02T12:36:10.678-04:00","expiresDateISO8601":"2019-05-02T12:36:10.678-04:00","terminatedDateISO8601":"2019-05-02T12:36:10.678-04:00","savedDateTimeISO8601":"2019-05-02T06:55:29.000-04:00","publishedDateTimeLocal":null,"scheduledDateTimeLocal":null,"expiresDateTimeLocal":null,"terminatedDateTimeLocal":null,"savedDateTimeLocal":null,"validPackageTypes":["WEATHER"],"zipCode":"35244","byLine":"ABC 33\/40","richText":"<p><strong>Thursday May 2, 2019{\/strong}<br><strong>Forecaster: James Spann{\/strong}{\/p}<p>WARM; A FEW SHOWERS: The weather pattern in place across Alabama is more like June instead of May. Warm, humid, and a few widely scattered showers and storms today. A few small but noisy clusters of storms moved northward during the pre-dawn hours; most of those have dissipated.{\/p}<p>The high today will be in the mid 80s with a mix of sun and clouds, and the chance of any one spot getting wet is around one in five.{\/p}<p>TOMORROW\/FRIDAY: Showers and storms will be a little more numerous on these two days, but still scattered and random. The sky will be cloudy at times, and the high will be in the mid 80s tomorrow, and close to 80 on Saturday. Best coverage of showers will come on Saturday, when any one spot has about a 50\/50 chance of getting wet. But, this won't be a \"wash out\" kind of day... just be ready for a few passing showers. A strong storm is also possible Saturday afternoon; SPC has defined a \"marginal risk\" (level 1\/5) of severe storms for North\/Central Alabama. Heavier storms Saturday afternoon will be capable of producing gusty winds and small hail. There is no tornado threat.{\/p}<p>SUNDAY AND NEXT WEEK: Drier air returns to the state, and Sunday will be mostly dry with just a few isolated showers for far South Alabama. The sky will be partly to mostly sunny with a high in the low 80s. Dry weather continues Monday and Tuesday... then we will have a chance of scattered showers and storms Wednesday through Friday. But the ridge holds, and it will be a summer type setup. Highs will be in the 80s during the week. {\/p}<p>PRE-SEASON TROPICAL ACTION: Hurricane season begins June 1, but it is possible to have mischief in May. A disturbance over the Bahamas has potential to bring rain to the Florida Peninsula today, but it will curve northeast over the next 48 hours. Odds of development (by NHC) are only 20 percent over the next five days, and there will be no impact to the Florida Panhandle or the Alabama Gulf Coast.{\/p}<p>ON THIS DATE IN 2010: May began with two days of historical rainfall over much of Middle Tennessee, with massive swath stretching along the I-40 corridor from Benton County to Davidson County. Some areas received nearly 20 inches of rain during this 2-day period, the highest of which was 19.41 inches reported by a CoCoRaHS observer in Camden, TN. Numerous rainfall records were broken at the Nashville International Airport, including the most rain received in a 6 hour period, highest calendar day rainfall, and wettest month, along with several others. Incredibly, the Nashville Airport experienced its wettest and third wettest days in history on back to back days. Many area rivers exceeded their record crest levels, including the Harpeth River near Kingston Springs, which rose to 13.8 feet above the previous record. The Cumberland River at Nashville reached its highest level since flood control was implemented in the late 1960s, flooding parts of downtown Nashville. Waters from the Cumberland reached as far inland as 2nd Avenue, flooding many downtown businesses. Forty-nine Tennessee counties were declared disaster areas with damage estimates of between $2 and $3 billion statewide. Many Nashville landmarks received damage from floodwaters, including Gaylord Opryland Hotel and the Grand Ole Opry.{\/p}<p><strong>THE BEACH FORECAST - <a  href=\"https:\/\/www.alabamawx.com\/?page_id=99654\" target=\"_blank\" title=\"https:\/\/www.alabamawx.com\/?pag