-05-02T12:36:10.678-04:00","savedDateTimeISO8601":"2019-05-02T06:55:29.000-04:00","publishedDateTimeLocal":null,"scheduledDateTimeLocal":null,"expiresDateTimeLocal":null,"terminatedDateTimeLocal":null,"savedDateTimeLocal":null,"validPackageTypes":["WEATHER"],"zipCode":"35244","byLine":"ABC 33\/40","richText":"<p><strong>Thursday May 2, 2019{\/strong}<br><strong>Forecaster: James Spann{\/strong}{\/p}<p>WARM; A FEW SHOWERS: The weather pattern in place across Alabama is more like June instead of May. Warm, humid, and a few widely scattered showers and storms today. A few small but noisy clusters of storms moved northward during the pre-dawn hours; most of those have dissipated.{\/p}<p>The high today will be in the mid 80s with a mix of sun and clouds, and the chance of any one spot getting wet is around one in five.{\/p}<p>TOMORROW\/FRIDAY: Showers and storms will be a little more numerous on these two days, but still scattered and random. The sky will be cloudy at times, and the high will be in the mid 80s tomorrow, and close to 80 on Saturday. Best coverage of showers will come on Saturday, when any one spot has about a 50\/50 chance of getting wet. But, this won't be a \"wash out\" kind of day... just be ready for a few passing showers. A strong storm is also possible Saturday afternoon; SPC has defined a \"marginal risk\" (level 1\/5) of severe storms for North\/Central Alabama. Heavier storms Saturday afternoon will be capable of producing gusty winds and small hail. There is no tornado threat.{\/p}<p>SUNDAY AND NEXT WEEK: Drier air returns to the state, and Sunday will be mostly dry with just a few isolated showers for far South Alabama. The sky will be partly to mostly sunny with a high in the low 80s. Dry weather continues Monday and Tuesday... then we will have a chance of scattered showers and storms Wednesday through Friday. But the ridge holds, and it will be a summer type setup. Highs will be in the 80s during the week. {\/p}<p>PRE-SEASON TROPICAL ACTION: Hurricane season begins June 1, but it is possible to have mischief in May. A disturbance over the Bahamas has potential to bring rain to the Florida Peninsula today, but it will curve northeast over the next 48 hours. Odds of development (by NHC) are only 20 percent over the next five days, and there will be no impact to the Florida Panhandle or the Alabama Gulf Coast.{\/p}<p>ON THIS DATE IN 2010: May began with two days of historical rainfall over much of Middle Tennessee, with massive swath stretching along the I-40 corridor from Benton County to Davidson County. Some areas received nearly 20 inches of rain during this 2-day period, the highest of which was 19.41 inches reported by a CoCoRaHS observer in Camden, TN. Numerous rainfall records were broken at the Nashville International Airport, including the most rain received in a 6 hour period, highest calendar day rainfall, and wettest month, along with several others. Incredibly, the Nashville Airport experienced its wettest and third wettest days in history on back to back days. Many area rivers exceeded their record crest levels, including the Harpeth River near Kingston Springs, which rose to 13.8 feet above the previous record. The Cumberland River at Nashville reached its highest level since flood control was implemented in the late 1960s, flooding parts of downtown Nashville. Waters from the Cumberland reached as far inland as 2nd Avenue, flooding many downtown businesses. Forty-nine Tennessee counties were declared disaster areas with damage estimates of between $2 and $3 billion statewide. Many Nashville landmarks received damage from floodwaters, including Gaylord Opryland Hotel and the Grand Ole Opry.{\/p}<p><strong>THE BEACH FORECAST - <a  href=\"https:\/\/www.alabamawx.com\/?page_id=99654\" target=\"_blank\" title=\"https:\/\/www.alabamawx.com\/?page_id=99654\">Get the latest weather and rip current forecasts for the beaches from Fort Morgan to Panama City.{\/a}{\/strong}<br>{\/p}<p><strong>THE SEVEN DAY FORECAST{\/strong} - <strong><a  href=\"https:\/\/www.alabamawx.com\/?page_id=31752\" target=\"_blank\" title=\"https:\/\/www.alabamawx.com\/?page_id=31752\">Get Central Alabama's Most Detailed Seven Day Forecast{\/a}{\/strong}{\/p}","forecast":{"externalServiceId":"USAL0054","zipCode":"35212","state":"Alabama","stateAbbreviation":"AL","city":"Birmingham","latitude":"33.52","longitude":"-86.81","current":{"relHumidity":65,"wndSpdMph":9,"wndDirDegr":"170","wndDirCardinal":"S","snowAmtIn":"","tempF":81,"precipChance":"0","iconCode":66,"skyText":"Scattered Clouds"},"weatherForecasts":[{"relHumidity":53,"wndSpdMph":8,"wndDirDegr":"172","wndDirCardinal":"S","snowAmtIn":"0.00","dateTime":1556802000000,"dayOfWeek":"Thursday","origHiTempF":87,"origLoTempF":67,"origPrecipChance":20,"origIconCode":87,"origSkyText":"Scattered Showers","modifiedHiTempF":87,"modifiedLoTempF":67,"modifiedPrecipChance":20,"modifiedIconCode":87,"modifiedSkyText":"Scattered Showers","modifiedPrecipitationChanceDay":null,"modifiedPrecipitationChanceNight":null,"hiddenWind":false,"modifiedWindDirectionCardinal":null,"modifiedWindDirectionCardinalNight":null,"modifiedWindDirectionDeg":null,"modifiedWindDirectionDegNight":null,"modifiedWindSpeedKm":null,"modifiedWindSpeedKmNight":null,"modifiedWindSpeedKn":null,"modifiedWindSpeedKnNight":null,"modifiedWindSpeedMph":null,"modifiedWindSpeedMphNight":null,"hiddenHumidity":false,"modifiedRelativeHumidity":null,"modifiedRelativeHumidityNight":null,"hiddenUv":false,"modifiedUvDescription":null,"modifiedUvIndex":null,"modifiedUvWarn":null,"phraseDay":"Partly to mostly cloudy. A stray shower or thunderstorm is possible. High 86F. Winds S at 5 to 10 mph.","sunrise":"05:58:15 am","sunset":"07:30:39 pm","shortPhrase":"Mix of sun and clouds","phraseNight":"Some clouds. A stray shower or thunderstorm is possible. Low 66F. Winds light and variable.","skyCode":"30","snowChance":"0","wndSpdKm":13,"wndSpdKn":7,"cloudCoverage":"59","uvIdx":"8","uvDescr":"Very High